	static void closetexture(int map[][],Console c,int x, int y){
		Image tex = Toolkit.getDefaultToolkit().getImage(c.getClass().getClassLoader().getResource("SAss/trees.png"));
		for(int i=-1;i++<5;){
			if (xct[i]-x>1200||xct[i]-x<-400){
				xct[i]=gen.nextInt(800);
				if (xct[i]>=400)
					xct[i]+=x+400;
				else if(xct[i]<400)
					xct[i]=x-xct[i];
		    	yct[i]=y;
		    	int k=0;
		    	while(map[(yct[i]+90)/20+k][(xct[i]+41)/20]%10<=0){
		    		k++;
		    	}yct[i]+=k*20;
			}
		c.drawImage(tex,xct[i]-x,yct[i]-y);}
	}
	static void l3text(Console c,int x, int y){
		Image t1 = Toolkit.getDefaultToolkit().getImage(c.getClass().getClassLoader().getResource("SAss/stru.png"));
		int p1[]={30,200,480};
		Image t2 = Toolkit.getDefaultToolkit().getImage(c.getClass().getClassLoader().getResource("SAss/opod.png"));
		int p2[]={50,200,270,440};
		for(int i=-1;i++<p1.length-1;)
			c.drawImage(t1, 200+p1[i]-x/3, 630-y);
		for(int i=-1;i++<p2.length-1;)
			c.drawImage(t2, 200+p2[i]-x/2, 700-y);
	}
